import React, { Component } from 'react'


class Maps extends Component {

    constructor() {
        super();
        this.state = {
            car: ['bmw', 'benz', 'tata'],
            party: { 1: 'bjp', 2: 'udf', 3: 'rss', 4: 'ldf' }
        }

    }
    render() {
        return (
            <div>
                <table>
                    <tr>{this.state.car.map((item, index) => {
                    return (
                        <li>{item}</li>
                    )
                })}</tr>
                </table>
            </div>
        )
    }
}

export default Maps;
